function beautifulIndices(s: string, a: string, b: string, k: number): number[] {
    const beautifulIndices: number[] = [];
    const aIndices: number[] = [];
    const bIndices: number[] = [];

    for (let i = 0; i <= s.length - a.length; i++) {
        if (s.substring(i, i + a.length) === a) aIndices.push(i);
    }
    for (let i = 0; i <= s.length - b.length; i++) {
        if (s.substring(i, i + b.length) === b) bIndices.push(i);
    }

    for (const i of aIndices) {
        for (const j of bIndices) {
            if (Math.abs(j - i) <= k) {
                beautifulIndices.push(i);
                break;
            }
        }
    }

    return beautifulIndices.sort((a, b) => a - b);
};
